var b="url",c="订单管理.html",d="generationDate",e=new Date(1602437350609.87),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="page",s="packageId",t="9bbc457be586432f8111380c5a4f89e7",u="type",v="Axure:Page",w="订单管理",x="notes",y="annotations",z="fn",A="1",B="ownerId",C="99f52f0885e24d21a4b1c97716bff189",D="label",E="无需审核",F="注释",G="<p><span>无需审核的订单，在此页面，不可被审核员看到，可被管理员看到</span></p>",H="2",I="0ef12a34961044c38d3e817a3827f5b1",J="已结束",K="<p><span>当前时间＞截止时间</span></p>",L="3",M="cc59b97db391429393b4ecfa83fd2272",N="日期",O="<p><span>结束时间：商户设置的订单结束时间</span></p>",P="4",Q="3cbd2ad611c34f01bd9c6f48e9224e46",R="全部通过",S="<p><span>点全部通过，对该订单下，所有的未审核任务，做审核合格处理</span></p><p><span><br></span></p><p><span>管理员不可点击此按钮</span></p>",T="5",U="4b41e2201bef4418863235e428a96933",V="<p><span>合格率：审核合格的任务数/已审核的任务数</span></p>",W="6",X="e8c931b59cee4668af26f6d64316191b",Y="审核中",Z="<p><span>某个审核员对某个订单点击了【审核】按钮，此时，这个订单的审核被该审核员领走，订单审核状态变为【审核中】。</span></p><p><span><br></span></p><p><span>审核中的订单，在此页面可被管理员看见，可被领走的审核员自己可见，不可被其他审核员看见。</span></p>",ba="7",bb="c231784bd99e461094320cb9f8cf9561",bc="已结算",bd="<p><span>每小时一次定时任务，对订单状态为【已结束】and订单审核状态为【无需审核】的，进行结算。</span></p><p><span><br></span></p><p><span>结算：将（预扣-消耗）的金额，退回到客户余额</span></p><p><span><br></span></p><p><span>结算后，将订单结算状态变更为【已结算】</span></p>",be="8",bf="1f0f6366f45f4a83a5ac444d31d4226a",bg="SH001",bh="<p><span>订单处于审核中时，该按钮变成红色，文字为领走的审核员的账号</span></p>",bi="9",bj="4c87f98407444412914f876624b25e83",bk="领取审核",bl="<p><span>管理员点此按钮，可进入【任务管理】页面，但在任务管理页面，不能点击【聚焦模式】，不能勾选任务，不能对任务进行审核</span></p>",bm="style",bn="baseStyle",bo="627587b6038d43cca051c114ac41ad32",bp="pageAlignment",bq="center",br="fill",bs="fillType",bt="solid",bu="color",bv=0xFFFFFFFF,bw="image",bx="imageAlignment",by="near",bz="imageRepeat",bA="auto",bB="favicon",bC="sketchFactor",bD="0",bE="colorStyle",bF="appliedColor",bG="fontName",bH="Applied Font",bI="borderWidth",bJ="borderVisibility",bK="borderFill"